import axios from 'axios';
const Index = () => <h1>Index page!</h1>;

Index.getInitialProps = async () => {
	const res = await axios.get('https://quotesondesign.com/wp-json/wp/v2/posts/?orderby=rand');
	const { data } = res;
	console.log(data);
	return res;
};

export default Index;
